import React from 'react';
import image_1 from '../images/346878451240442.jpeg'
import image_2 from '../images/Samizdat.jpg'
import image_3 from '../images/Depositphotos_73146765_l-2015.jpg'
import '../styles/body.css'
const Body = () => {
    return (
        <div className={"main-block"}>
            <div className={"block-1"}>
                <img className={"img-1"} src={image_1} alt=""/>
                <p className={"p-1"}>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Aperiam, autem beatae dicta eos et in non quasi repudiandae sequi voluptatibus. Aut dolorem, eos est magnam magni maxime praesentium quo ullam.</p>
            </div>
            <div className={"block-2"}>
                <p className={"p-2"}>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Aspernatur culpa dolorum nobis! Eaque eveniet minus omnis pariatur perferendis recusandae tempore. Ab autem consequuntur ex fuga laboriosam laudantium nulla voluptas. Alias!</p>
                <img className={"img-2"} src={image_2} alt=""/>
            </div>
            <div className={"block-3"}>
                <img className={"img-3"} src={image_3} alt=""/>
                <p className={"p-3"}>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Ad cupiditate dicta doloremque error expedita libero natus nobis repellendus? Consequatur, consequuntur, vel? Ab alias aperiam ex inventore numquam quasi rerum! Laborum!</p>
            </div>
        </div>
    );
};

export default Body;
